import React, { Component } from 'react';
import styled from 'styled-components';
import { Link } from 'react-router-dom';

class Navigation extends Component {

  
    render() {
      return (
        <Nav>
            <NavList>
            <NavItem><Link to='/about' style={{ textDecoration: 'none',color:'#ea2c62' }}>소개</Link></NavItem>
                <NavItem><Link to='/board' style={{ textDecoration: 'none',color:'#ea2c62' }}>게시판</Link></NavItem>
                <NavItem><Link to='/myboard' style={{ textDecoration: 'none' ,color:'#ea2c62' }}>내 글보기</Link></NavItem>
                <NavItem><Link to='/mypage' style={{ textDecoration: 'none' ,color:'#ea2c62' }}>마이페이지</Link></NavItem>
            </NavList>
        </Nav>
      );
    }
  }
  
export default Navigation;

const Nav = styled.div`
    width: 100%;
    height: 30px;
    border-bottom: 1px solid #d1d8e4;
    
`

const NavList = styled.ul`
    width: 1080px;
    display: flex;
    margin: 0 auto;
    text-align:center;
    
`

const NavItem = styled.li`
    width: 100px;
    margin-left: 18px;
    margin-top: 5px;
    display: flex;
    color: pink;
`
